import React from 'react'
import { Box, TextField } from '@mui/material'

function Contact() {
  return (
    <Box
    component="form"
    sx={{
      '& .MuiTextField-root': { m: 1, width: '25ch' },
      bgcolor:"silver",
      pb:20,
      pt:10,

    }}
    noValidate
    autoComplete="off"
  >
    <div>
      <TextField
        id="outlined-multiline-flexible"
        label="Multiline"
        multiline
        maxRows={4}
        sx={{
            width: "50%",
            m:'auto'
        }}
      />
      </div>
      </Box>
  )
}

export default Contact
